    <style>
        .preloader {
            position: absolute;
            top: 0;
            left: 0;
            width: 100vw!important;
            height: 100vh!important;
            z-index: 1;
            overflow: hidden;
            user-select: none
        }
        
        .preloader__wrapper {
            position: absolute;
            width: 90%;
            top: 50%;
            left: 50%;
            transform: translate(-50%, -50%);
            text-align: center;
            display: flex;
            flex-direction: column;
            opacity: 1;
            z-index: 1
        }
        
        .preloader__circle {
            animation: 1s ease-out 0s 1 fadeIn;
            transform-origin: center
        }
        
        .preloader__title {
            display: block;
            color: #fff;
            font-family: sans-serif;
            font-size: 1.5rem;
            text-align: center;
            margin-top: 1.2rem;
            opacity: .9;
            animation: 1.1s ease-out 0s 1 slideIn
        }
        
        .preloader__background {
            position: absolute;
            width: 100%;
            height: 100%;
            z-index: -1;
            animation: 20s ease-out 0s 1 backScale
        }
        
        .preloader__placeholder {
            width: 130px;
            height: 130px;
            margin: 10px;
            display: inline-block
        }
        
        .preloader__icon {
            width: 130px;
            height: 130px;
            z-index: 1;
            border-radius: 50%;
            border: 10px solid rgba(255, 255, 255, .2)
        }
        
        .preloader__logo {
            position: absolute;
            bottom: 5%;
            left: 50%;
            transform: translateX(-50%);
            width: 20%;
            max-width: 100px;
            opacity: .6;
            z-index: 1;
            text-align: center
        }
        
        .preloader__logo svg {
            width: 100%;
            margin-bottom: -8px;
            animation: .7s ease-out 0s 1 slideInTwo
        }
        
        .preloader__logo span {
            display: block;
            color: #fff;
            font-family: sans-serif;
            font-size: .6rem;
            font-weight: 300;
            animation: .5s ease-out 0s 1 slideInOne
        }
        
        .preloader:after {
            content: '';
            position: absolute;
            width: 100%;
            height: 100%;
            background: #000;
            opacity: .75;
            object-fit: cover
        }
        
        .preloader-ring {
            position: absolute;
            left: 50%;
            transform: translate(-50%, 0);
            z-index: 1;
            margin-top: -5px
        }
        
        .preloader-ring__circle {
            transform: rotate(-90deg);
            transform-origin: 50% 50%;
            stroke-dasharray: 691.15, 691.15;
            stroke-dashoffset: 691.15;
            animation: dash 40s cubic-bezier(.165, .84, .44, 1) forwards;
            animation-delay: 1s
        }
        
        @media screen and (max-height:500px) {
            .preloader__wrapper {
                transform: scale(.75) translate(-50%, -50%);
                transform-origin: top left
            }
            .preloader__logo svg {
                height: 8vh;
                margin-top: 2px
            }
        }
        
        @keyframes dash {
            to {
                stroke-dashoffset: 0
            }
        }
        
        @keyframes fadeIn {
            0% {
                opacity: 0;
                transform: scale(.9)
            }
            50% {
                opacity: 0;
                transform: scale(.9)
            }
            100% {
                opacity: 1;
                transform: scale(1)
            }
        }
        
        @keyframes slideIn {
            0% {
                transform: translateY(1rem);
                opacity: 0
            }
            75% {
                transform: translateY(1rem);
                opacity: 0
            }
            100% {
                transform: translateY(0);
                opacity: .9
            }
        }
        
        @keyframes slideInOne {
            0% {
                transform: translateY(1rem);
                opacity: 0
            }
            100% {
                transform: translateY(0);
                opacity: 1
            }
        }
        
        @keyframes slideInTwo {
            0% {
                transform: translateY(1rem);
                opacity: 0
            }
            40% {
                transform: translateY(1rem);
                opacity: 0
            }
            100% {
                transform: translateY(0);
                opacity: 1
            }
        }
        
        @keyframes backScale {
            0% {
                transform: scale(1)
            }
            100% {
                transform: scale(1.2)
            }
        }
    </style>
